import {Container, Row, Col, Button} from "react-bootstrap";
const Sign = () => {
    return ( 
        <Container className="sign" fluid>
            <Row>
                <LeftComponent />
                <RightComponent />
            </Row>
        </Container>
    );
}
export default Sign;
function LeftComponent(){
    return (
        <Col className="signLeft">
            <h4>lado Izquierdo</h4>
        </Col>
    );
}
function RightComponent(){
    return (
        <Col className="signRight">
            <h4>lado Derecho</h4>
        </Col>
    );
}
